class Solution(object):
    def minimumCost(self, nums, k, dist):
        """
        :type nums: List[int]
        :type k: int
        :type dist: int
        :rtype: int
        """
        from heapq import nsmallest

        def dp(i, k):
            if k == 0 and i == len(nums): return 0
            if k <= 0 or i >= len(nums): return float('inf')
            if (i, k) in memo: return memo[(i, k)]

            ans = float('inf')
            for j in range(i, min(i + dist + 1, len(nums) - k + 2)):
                ans = min(ans, nums[i] + dp(j + 1, k - 1))
            memo[(i, k)] = ans
            return ans

        memo = {}
        return dp(0, k)
